import React from "react";


function Room() {
  //console.log(props);
  const myVideo = {
    id: 0,
    name: mine
  }
  const peerVideos = [
    {
        id: 1,
        name: "SSam"
    },
    {
        id: 2,
        name: "SSong"
    }
  ];
  return (
    <div>
      <h1>OrchestLive!</h1>
      <div className="call">
        <h1>Room Name : </h1>
        <h3>Client : </h3>
        <VideoRayoutContainer l={peerVideos.length} streamArray={peerVideos} myStream={myVideo}>
                <VideoBox stream={myVideo} autoPlay></VideoBox>
                {
                    peerStreamArray.map((item, key) => (
                        <VideoBox key={key} stream={item.stream} />
                    ))
                }
        </VideoRayoutContainer>
        <div className="Streams">
          <video 
            key = {myVideo.id}
            className={myVideo.name}
            autoPlay
            playsInline
            width="400" 
            height="400"/>
          {peerVideos.map(peer => (
            <video 
              key = {peer.id}
              className={peer.name}
              autoPlay
              playsInline
              width="400" 
              height="400"/>
          ))}
        </div>
    
        <button className="mute">Mute</button>
        <button className="camera">Turn Camera Off</button>
        <select className="cameras"/>
      </div>
    </div>
  );
  
  
}

export default Room;
